import { Row, Col } from "antd";
import LoginForm from "../../components/LoginForm";
import { GlobalContainer, ContentContainer } from "./styles";
import campusImage from "../static/img/first_bg_round_real.png";

const login = () => {
  return (
    <GlobalContainer>
      <ContentContainer>
        <Row>
          <Col xs={24} md={12}>
            <ContentBox>
                <ImageSection className="forth-box_flow">
          <Image src={campusImage} alt="" />
        </ImageSection>

              <div></div>
            </ContentBox>
          </Col>
          <Col xs={24} md={12}>
            <LoginForm></LoginForm>
          </Col>
        </Row>
      </ContentContainer>
      {/* <Footer>

      </Footer> */}
    </GlobalContainer>

    /* <Row gutter={8}>
        <Col xs={24} md={6} />
        <Col xs={24} md={12}>
          <LoginForm />
        </Col>
        <Col xs={24} md={6} />
      </Row> */
  );
};

export default login;
